    <script>// Pandoc 2.9 adds attributes on both header and div. We remove the former (to
// be compatible with the behavior of Pandoc < 2.8).
document.addEventListener('DOMContentLoaded', function(e) {
  var hs = document.querySelectorAll("div.section[class*='level'] > :first-child");
  var i, h, a;
  for (i = 0; i < hs.length; i++) {
    h = hs[i];
    if (!/^h[1-6]$/i.test(h.tagName)) continue;  // it should be a header h1-h6
    a = h.attributes;
    while (a.length > 0) h.removeAttribute(a[0].name);
  }
});
</script>

    <script>/* global slideshow */
(function () {
  const ready = function (fn) {
    /* MIT License Copyright (c) 2016 Nuclei */
    /* https://github.com/nuclei/readyjs */
    const completed = () => {
      document.removeEventListener('DOMContentLoaded', completed)
      window.removeEventListener('load', completed)
      fn()
    }
    if (document.readyState !== 'loading') {
      setTimeout(fn)
    } else {
      document.addEventListener('DOMContentLoaded', completed)
      window.addEventListener('load', completed)
    }
  }

  ready(function () {
    [...document.querySelectorAll('.panel-name')]
      .map(el => el.textContent.trim())

    const panelIds = {}

    const uniquePanelId = (name) => {
      name = encodeURIComponent(name.toLowerCase().replace(/[\s]/g, '-'))
      if (Object.keys(panelIds).includes(name)) {
        name += ++panelIds[name]
      } else {
        panelIds[name] = 1
      }
      return name
    }

    const identifyPanelName = (item) => {
      let name = 'Panel'

      // If the item doesn't have a parent element, then we've already processed
      // it, probably because we're in an Rmd, and it's been removed from the DOM
      if (!item.parentElement) {
        return
      }

      // In R Markdown when header-attrs.js is present, we may have found a
      // section header but the class attributes won't be duplicated on the <hX> tag
      if (
        (item.tagName === 'SECTION' || item.classList.contains('section')) &&
        /^H[1-6]/.test(item.children[0].tagName)
      ) {
        name = item.children[0].textContent
        item.classList.remove('panel-name')
        item.removeChild(item.children[0])
        return name
      }

      const nameDiv = item.querySelector('.panel-name')
      if (!nameDiv) return name

      // In remarkjs the .panel-name span might be in a paragraph tag
      // and if the <p> is empty, we'll remove it
      if (
        nameDiv.tagName === 'SPAN' &&
        nameDiv.parentNode.tagName === 'P' &&
        nameDiv.textContent === nameDiv.parentNode.textContent
      ) {
        name = nameDiv.textContent
        item.removeChild(nameDiv.parentNode)
        return name
      }

      // If none of the above, remove the nameDiv and return the name
      name = nameDiv.textContent
      nameDiv.parentNode.removeChild(nameDiv)
      return name
    }

    const processPanelItem = (item) => {
      const name = identifyPanelName(item)
      if (!name) {
        return null
      }
      return { name, content: item.children, id: uniquePanelId(name) }
    }

    const getCurrentPanelFromUrl = (panelset) => {
      const params = new URLSearchParams(window.location.search)
      return params.get(panelset)
    }

    const reflowPanelSet = (panels, idx) => {
      const res = document.createElement('div')
      res.className = 'panelset'
      res.id = 'panelset' + (idx > 0 ? idx : '')
      const panelSelected = getCurrentPanelFromUrl(res.id)

      // create header row
      const headerRow = document.createElement('ul')
      headerRow.className = 'panel-tabs'
      headerRow.setAttribute('role', 'tablist')
      panels
        .map((p, idx) => {
          const panelHeaderItem = document.createElement('li')
          panelHeaderItem.className = 'panel-tab'
          panelHeaderItem.setAttribute('role', 'tab')
          const thisPanelIsActive = panelSelected ? panelSelected === p.id : idx === 0
          if (thisPanelIsActive) {
            panelHeaderItem.classList.add('panel-tab-active')
            panelHeaderItem.setAttribute('aria-selected', true)
          }
          panelHeaderItem.tabIndex = 0
          panelHeaderItem.id = res.id + '_' + p.id // #panelsetid_panelid

          const panelHeaderLink = document.createElement('a')
          panelHeaderLink.href = '?' + res.id + '=' + p.id + '#' + panelHeaderItem.id
          panelHeaderLink.setAttribute('onclick', 'return false;')
          panelHeaderLink.tabIndex = -1 // list item is tabable, not link
          panelHeaderLink.innerHTML = p.name
          panelHeaderLink.setAttribute('aria-controls', p.id)

          panelHeaderItem.appendChild(panelHeaderLink)
          return panelHeaderItem
        })
        .forEach(el => headerRow.appendChild(el))

      res.appendChild(headerRow)

      panels
        .map((p, idx) => {
          const panelContent = document.createElement('section')
          panelContent.className = 'panel'
          panelContent.setAttribute('role', 'tabpanel')
          const thisPanelIsActive = panelSelected ? panelSelected === p.id : idx === 0
          panelContent.classList.toggle('panel-active', thisPanelIsActive)
          panelContent.id = p.id
          panelContent.setAttribute('aria-labelledby', p.id)
          Array.from(p.content).forEach(el => panelContent.appendChild(el))
          return panelContent
        })
        .forEach(el => res.appendChild(el))

      return res
    }

    /*
     * Update selected panel for panelset or delete panelset from query string
     *
     * @param panelset Panelset ID to update in the search params
     * @param panel Panel ID of selected panel in panelset, or null to delete from search params
     * @param params Current params object, or params from window.location.search
     */
    function updateSearchParams (panelset, panel, params = new URLSearchParams(window.location.search)) {
      if (panel) {
        params.set(panelset, panel)
      } else {
        params.delete(panelset)
      }
      return params
    }

    /*
     * Update the URL to match params
     */
    const updateUrl = (params) => {
      if (typeof params === 'undefined') return
      params = params.toString() ? ('?' + params.toString()) : ''
      const { pathname, hash } = window.location
      const uri = pathname + params + hash
      window.history.replaceState(uri, '', uri)
    }

    const togglePanel = (clicked) => {
      if (clicked.nodeName.toUpperCase() === 'A') {
        clicked = clicked.parentElement
      }
      if (!clicked.classList.contains('panel-tab')) return
      if (clicked.classList.contains('panel-tab-active')) return

      const tabs = clicked.parentNode
        .querySelectorAll('.panel-tab')
      const panels = clicked.parentNode.parentNode
        .querySelectorAll('.panel')
      const panelTabClicked = clicked.children[0].getAttribute('aria-controls')
      const panelClicked = clicked.parentNode.parentNode.id

      Array.from(tabs)
        .forEach(t => {
          t.classList.remove('panel-tab-active')
          t.removeAttribute('aria-selected')
        })
      Array.from(panels)
        .forEach(p => {
          const active = p.id === panelTabClicked
          p.classList.toggle('panel-active', active)
          // make inactive panels inaccessible by keyboard navigation
          if (active) {
            p.removeAttribute('tabIndex')
            p.removeAttribute('aria-hidden')
          } else {
            p.setAttribute('tabIndex', -1)
            p.setAttribute('aria-hidden', true)
          }
        })

      clicked.classList.add('panel-tab-active')
      clicked.setAttribute('aria-selected', true)

      // emit window resize event to trick html widgets into fitting to the panel width
      window.dispatchEvent(new Event('resize'))

      // update query string
      const params = updateSearchParams(panelClicked, panelTabClicked)
      updateUrl(params)
    }

    const initPanelSet = (panelset, idx) => {
      let panels = Array.from(panelset.querySelectorAll('.panel'))
      if (!panels.length && panelset.matches('.section[class*="level"]')) {
        // we're in tabset-alike R Markdown
        const panelsetLevel = [...panelset.classList]
          .filter(s => s.match(/^level/))[0]
          .replace('level', '')

        // move children that aren't inside a section up above the panelset
        Array.from(panelset.children).forEach(function (el) {
          if (el.matches('div.section[class*="level"]')) return
          panelset.parentElement.insertBefore(el, panelset)
        })

        // panels are all .sections with .level<panelsetLevel + 1>
        const panelLevel = +panelsetLevel + 1
        panels = Array.from(panelset.querySelectorAll(`.section.level${panelLevel}`))
      }

      if (!panels.length) return

      const contents = panels.map(processPanelItem).filter(o => o !== null)
      const newPanelSet = reflowPanelSet(contents, idx)
      newPanelSet.classList = panelset.classList
      panelset.parentNode.insertBefore(newPanelSet, panelset)
      panelset.parentNode.removeChild(panelset)

      // click and touch events
      const panelTabs = newPanelSet.querySelector('.panel-tabs');
      ['click', 'touchend'].forEach(eventType => {
        panelTabs.addEventListener(eventType, function (ev) {
          togglePanel(ev.target)
          ev.stopPropagation()
        })
      })
      panelTabs.addEventListener('touchmove', function (ev) {
        ev.preventDefault()
      })

      // key events
      newPanelSet
        .querySelector('.panel-tabs')
        .addEventListener('keydown', (ev) => {
          const self = ev.currentTarget.querySelector('.panel-tab-active')
          if (ev.code === 'Space' || ev.code === 'Enter') {
            togglePanel(ev.target)
            ev.stopPropagation()
          } else if (ev.code === 'ArrowLeft' && self.previousSibling) {
            togglePanel(self.previousSibling)
            self.previousSibling.focus()
            ev.stopPropagation()
          } else if (ev.code === 'ArrowRight' && self.nextSibling) {
            togglePanel(self.nextSibling)
            self.nextSibling.focus()
            ev.stopPropagation()
          }
        })

      return panels
    }

    // initialize panels
    Array.from(document.querySelectorAll('.panelset')).map(initPanelSet)

    if (typeof slideshow !== 'undefined') {
      const getVisibleActivePanelInfo = () => {
        const slidePanels = document.querySelectorAll('.remark-visible .panel-tab-active')

        if (!slidePanels.length) return null

        return slidePanels.map(panel => {
          return {
            panel,
            panelId: panel.children[0].getAttribute('aria-controls'),
            panelSetId: panel.parentNode.parentNode.id
          }
        })
      }

      slideshow.on('hideSlide', slide => {
        // clear focus if we had a panel-tab selected
        document.activeElement.blur()

        // clear search query for panelsets in current slide
        const params = [...document.querySelectorAll('.remark-visible .panelset')]
          .reduce(function (params, panelset) {
            return updateSearchParams(panelset.id, null, params)
          }, new URLSearchParams(window.location.search))

        updateUrl(params)
      })

      slideshow.on('afterShowSlide', slide => {
        const slidePanels = getVisibleActivePanelInfo()

        if (slidePanels) {
          // only first panel gets focus
          slidePanels[0].panel.focus()
          // but still update the url to reflect all active panels
          const params = slidePanels.reduce(
            function (params, { panelId, panelSetId }) {
              return updateSearchParams(panelSetId, panelId, params)
            },
            new URLSearchParams(window.location.search)
          )
          updateUrl(params)
        }
      })
    }
  })
})()
</script>

:root {

--text-font-family: 'Source Sans Pro';
--text-font-is-google: 1;
--text-font-family-fallback: -apple-system, BlinkMacSystemFont, avenir next, avenir, helvetica neue, helvetica, Ubuntu, roboto, noto, segoe ui, arial;
--text-font-base: sans-serif;
--header-font-family: 'Source Sans Pro';
--header-font-is-google: 1;
--header-font-family-fallback: Georgia, serif;
--code-font-family: 'Source Code Pro';
--code-font-is-google: 1;
--base-font-size: 20px;
--text-font-size: 1rem;
--code-font-size: 0.9rem;
--code-inline-font-size: 1em;
--header-h1-font-size: 2.75rem;
--header-h2-font-size: 2.25rem;
--header-h3-font-size: 1.75rem;

--text-color: #272822;
--header-color: #000000;
--background-color: #FFFFFF;
--link-color: #0F4C81;
--text-bold-color: #0F4C81;
--code-highlight-color: rgba(255,255,0,0.5);
--inverse-text-color: #FFFFFF;
--inverse-background-color: #0F4C81;
--inverse-header-color: #FFFFFF;
--inverse-link-color: #0F4C81;
--title-slide-background-color: #0F4C81;
--title-slide-text-color: #FFFFFF;
--header-background-color: #000000;
--header-background-text-color: #FFFFFF;
--base: #0F4C81;
--white: #FFFFFF;
--black: #272822;
}
html {
font-size: var(--base-font-size);
}
body {
font-family: var(--text-font-family), var(--text-font-family-fallback), var(--text-font-base);
font-weight: 400;
color: var(--text-color);
}
h1, h2, h3 {
font-family: var(--header-font-family), var(--header-font-family-fallback);
font-weight: 400;
color: var(--header-color);
}
.remark-slide-content {
background-color: var(--background-color);
font-size: 1rem;
padding: 16px 64px 16px 64px;
width: 100%;
height: 100%;
}
.remark-slide-content h1 {
font-size: var(--header-h1-font-size);
}
.remark-slide-content h2 {
font-size: var(--header-h2-font-size);
}
.remark-slide-content h3 {
font-size: var(--header-h3-font-size);
}
.remark-code, .remark-inline-code {
font-family: var(--code-font-family), Menlo, Consolas, Monaco, Liberation Mono, Lucida Console, monospace;
}
.remark-code {
font-size: var(--code-font-size);
}
.remark-inline-code {
font-size: var(--code-inline-font-size);
color: #0F4C81;
}
.remark-slide-number {
color: #0F4C81;
opacity: 1;
font-size: 0.9rem;
}
strong {
font-weight: bold;
color: var(--text-bold-color);
}
a, a > code {
color: var(--link-color);
text-decoration: none;
}
.footnote {
position: absolute;
bottom: 60px;
padding-right: 4em;
font-size: 0.9em;
}
.remark-code-line-highlighted {
background-color: var(--code-highlight-color);
}
.inverse {
background-color: var(--inverse-background-color);
color: var(--inverse-text-color);
}
.inverse h1, .inverse h2, .inverse h3 {
color: var(--inverse-header-color);
}
.inverse a, .inverse a > code {
color: var(--inverse-link-color);
}
.title-slide, .title-slide h1, .title-slide h2, .title-slide h3 {
color: var(--title-slide-text-color);
}
.title-slide {
background-color: var(--title-slide-background-color);
}
.title-slide .remark-slide-number {
display: none;
}

.left-column {
width: 20%;
height: 92%;
float: left;
}
.left-column h2, .left-column h3 {
color: #0F4C8199;
}
.left-column h2:last-of-type, .left-column h3:last-child {
color: #0F4C81;
}
.right-column {
width: 75%;
float: right;
padding-top: 1em;
}
.pull-left {
float: left;
width: 47%;
}
.pull-right {
float: right;
width: 47%;
}
.pull-right + * {
clear: both;
}
img, video, iframe {
max-width: 100%;
}
blockquote {
border-left: solid 5px #0F4C8180;
padding-left: 1em;
}
.remark-slide table {
margin: auto;
border-top: 1px solid #666;
border-bottom: 1px solid #666;
}
.remark-slide table thead th {
border-bottom: 1px solid #ddd;
}
th, td {
padding: 5px;
}
.remark-slide table:not(.table-unshaded) thead,
.remark-slide table:not(.table-unshaded) tfoot,
.remark-slide table:not(.table-unshaded) tr:nth-child(even) {
background: #CFDBE5;
}
table.dataTable tbody {
background-color: var(--background-color);
color: var(--text-color);
}
table.dataTable.display tbody tr.odd {
background-color: var(--background-color);
}
table.dataTable.display tbody tr.even {
background-color: #CFDBE5;
}
table.dataTable.hover tbody tr:hover, table.dataTable.display tbody tr:hover {
background-color: rgba(255, 255, 255, 0.5);
}
.dataTables_wrapper .dataTables_length, .dataTables_wrapper .dataTables_filter, .dataTables_wrapper .dataTables_info, .dataTables_wrapper .dataTables_processing, .dataTables_wrapper .dataTables_paginate {
color: var(--text-color);
}
.dataTables_wrapper .dataTables_paginate .paginate_button {
color: var(--text-color) !important;
}

.remark-slide-content.left pre,
.remark-slide-content.center pre,
.remark-slide-content.right pre {
text-align: start;
width: max-content;
max-width: 100%;
}
.remark-slide-content.left pre,
.remark-slide-content.right pre {
min-width: 50%;
min-width: min(40ch, 100%);
}
.remark-slide-content.center pre {
min-width: 66%;
min-width: min(50ch, 100%);
}
.remark-slide-content.left pre {
margin-left: unset;
margin-right: auto;
}
.remark-slide-content.center pre {
margin-left: auto;
margin-right: auto;
}
.remark-slide-content.right pre {
margin-left: auto;
margin-right: unset;
}

.remark-slide-content.header_background > h1 {
display: block;
position: absolute;
top: 0;
left: 0;
width: 100%;
background: var(--header-background-color);
color: var(--header-background-text-color);
padding: 2rem 64px 1.5rem 64px;
margin-top: 0;
box-sizing: border-box;
}
.remark-slide-content.header_background {
padding-top: 7rem;
}
@page { margin: 0; }
@media print {
.remark-slide-scaler {
width: 100% !important;
height: 100% !important;
transform: scale(1) !important;
top: 0 !important;
left: 0 !important;
}
}
.base {
color: var(--base);
}
.bg-base {
background-color: var(--base);
}
.white {
color: var(--white);
}
.bg-white {
background-color: var(--white);
}
.black {
color: var(--black);

# Learning objectives

1. Interpret a confidence interval as the plausible values of a parameter that would not be rejected in a two-sided hypothesis test.

1. Determine the decision for a two-sided hypothesis test from an appropriately constructed confidence interval.

1. Be able to explain the difference between a significant result and an important result.

# Part A
## Introduction


---
# Population vs Sample

- We performed a study by selecting a sample from the population.

- The goal is to use the sample data to answer questions about the population data. For example:

    + What&#39;s the population mean? __Goal A:__ estimating a parameter.
    
    + Could the population mean be zero? __Goal B:__ testing a theory (hypothesis) about a parameter.
    

---
# Confidence interval

&lt;div class=&quot;figure&quot; style=&quot;text-align: center&quot;&gt;
&lt;img src=&quot;data:image/png;base64,#images/pimpa-1.png&quot; alt=&quot;Figure 1. Invisible lady walking her dog.&quot; width=&quot;15%&quot; /&gt;
&lt;p class=&quot;caption&quot;&gt;Figure 1. Invisible lady walking her dog.&lt;/p&gt;
&lt;/div&gt;

.pull-left[
- We said that the SE of the mean measures how far `\(\bar x\)` is likely to be from the population mean `\(\mu\)`.

- Figure 1 is a drawing of an invisible lady walking her dog. The dog, which is visible, is on a leash. The leash is such that the dog is within `\(t^* \cdot SE\)` of the lady 95% of the time.

- __In one picture__ we can see the dog, but we would like to know where the lady is.
]

.pull-right[
- Since the lady and the dog are usually within `\(t^* \cdot SE\)` of each other, we can take the following interval as a range that would __typically__ include the lady:

    `$$[\textrm{dog} - t^* \cdot SE , \ \textrm{dog} + t^* \cdot SE]$$`

    or, in short:

    `$$\textrm{dog} \pm t^* \cdot SE$$`

- We could say that we are 95% confident that the lady is within this interval.

]

???

picture (= one sample) 

If the dog pulls too hard or the lady drops the leash, the position of the lady may not be within that interval.


---
# Confidence interval

- We have one picture, which corresponds to one sample.

- We would like to know the value of the population mean `\(\mu\)`, which corresponds to the invisible lady, but we cannot directly observe it.

- We can however see the sample mean `\(\bar x\)`, corresponding to the dog.

- We use what we can see, `\(\bar x\)`, along with its standard error, as a way of constructing an interval that we hope will include what we cannot see, i.e. the population mean `\(\mu\)`.

- The interval `\(\textrm{dog} \pm t^* \cdot SE\)` is a 95% confidence interval for the position of the lady.

- The interval `\(\bar x \pm t^* \cdot SE\)` is a 95% confidence interval for the population mean `\(\mu\)`. 

    + Recall that the standard error of the mean is computed as `\(SE = s / \sqrt{n}\)`.


---
# Hypothesis testing

.pull-left[
Consider this example:

- Sample of `\(n = 30\)`, with mean `\(\bar x = 47\)` and `\(s = 5.5\)`

- Want to test whether
`$$H_0 : \mu = 50 \\ H_1: \mu \neq 50$$`

- `\(SE = s / \sqrt n = 5.5 / \sqrt{30} = 1.004\)`

- `\(t = \frac{47 - 50}{1.004} = -2.99\)`

- The sample mean (47) is about 3 standard errors smaller than the claimed mean (50)
]

]

- Critical values for a `\(t(29)\)` distribution with `\(\alpha = 0.05\)`:


```r
tstar &lt;- qt(c(0.025, 0.975), df = 29)
tstar
```

```
## [1] -2.045  2.045
```

- As `\(t \leq -t^*\)`, we reject `\(H_0\)`.

# Part B
## Hypothesis testing &amp; Confidence intervals


---
# Hypothesis testing

- Consider again the following example, where we wish to test the following claim at the `\(\alpha = 0.05\)` significance level:
`$$H_0: \mu = \mu_0 \qquad \text{vs} \qquad H_1 : \mu \neq \mu_0$$`

--

- We start by computing the observed value of the t-statistic for our sample:

`$$t = \frac{\bar x - \mu_0}{s / \sqrt n}$$`

--

.pull-left[
&lt;center&gt;__P-value method__&lt;/center&gt;
- Compute the p-value, i.e. probability of obtaining a test statistic at least as extreme as the observed one, when `\(H_0\)` is true.

    ```
    2 * pt(abs(tobs), df = n-1, lower.tail = FALSE)
    ```
- Make a decision:

    + Reject `\(H_0\)` if `\(p \leq \alpha\)`
    + Do not reject `\(H_0\)` if `\(p &gt; \alpha\)`
]

.pull-right[
&lt;center&gt;__Critical value method__&lt;/center&gt;
- Compute the lower and upper critical values `\(-t^*\)` and `\(t^*\)`:

    ```
    qt(c(0.025, 0.975), df = n-1)
    ```

- Make a decision:

    + Reject `\(H_0\)` if `\(t \leq -t^*\)` or `\(t \geq +t^*\)`
    + Do not reject `\(H_0\)` if `\(-t^* &lt; t &lt; +t^*\)`
]

---
# Hypothesis testing

- __Do not reject `\(H_0 : \mu = \mu_0\)` if:__

`$$-t^* &lt; t &lt; +t^*$$`
`$$-t^* &lt; \frac{\bar x - \mu_0}{\frac{s}{\sqrt n}} &lt; +t^*$$`
`$$-t^* \cdot \frac{s}{\sqrt n} &lt; \bar x - \mu_0 &lt; +t^* \cdot \frac{s}{\sqrt n}$$`

`$$-\bar x -t^* \cdot \frac{s}{\sqrt n} &lt; - \mu_0 &lt; -\bar x + t^* \cdot \frac{s}{\sqrt n}$$`

`$$\bar x + t^* \cdot \frac{s}{\sqrt n} &gt; \mu_0 &gt; \bar x - t^* \cdot \frac{s}{\sqrt n}$$`

`$$\bar x - t^* \cdot \frac{s}{\sqrt n} &lt; \mu_0 &lt; \bar x + t^* \cdot \frac{s}{\sqrt n}$$`


---
# Hypothesis testing


.pull-left[
- __Do not reject `\(H_0 : \mu = \mu_0\)` when:__

`$$\underbrace{\bar x - t^* \cdot \frac{s}{\sqrt n}}_{\text{lower limit of CI}} &lt; \mu_0 &lt; \underbrace{\bar x + t^* \cdot \frac{s}{\sqrt n}}_{\text{upper limit of CI}}$$`
]


.pull-right[
- __Reject `\(H_0 : \mu = \mu_0\)` when either:__

`$$\mu_0 \geq \underbrace{\bar x + t^* \cdot \frac{s}{\sqrt n}}_{\text{upper limit of CI}}$$`
`\(\qquad \text{or}\)`

`$$\mu_0 \leq \underbrace{\bar x - t^* \cdot \frac{s}{\sqrt n}}_{\text{lower limit of CI}}$$`
]


--

- That is, we __do not reject `\(H_0\)`__ when `\(\mu_0\)` lies within the CI:

`$$\text{Do not reject } H_0 \text{ if }  
\left[ 
\bar x - t^* \cdot \frac{s}{\sqrt n}, \ \ 
\bar x + t^* \cdot \frac{s}{\sqrt n}
\right]\text{ includes } \mu_0$$`

# Part C
## Significance vs Importance

---
# Body temperature example

- Recall the body temperature study, where the goal was to assess whether the sample data provide evidence, at the 5% significance level, that the population mean body temperature for healthy humans changed from the long thought 37 Â°C.

--

- Data:


```r
library(tidyverse)
tempsample &lt;- read_csv(&#39;https://uoepsy.github.io/data/BodyTemperatures.csv&#39;)
tempsample &lt;- tempsample %&gt;% drop_na(BodyTemp)
```

# Body temperature example

.pull-left[
- Null and alternative hypotheses:
`$$H_0 : \mu = 37 \\ H_1 : \mu \neq 37$$`

- Chosen significance level: `\(\alpha = 0.05\)`

- Test statistic:
`$$t = \frac{\bar x - 37}{s / \sqrt{n}}$$`
]

.pull-right[

```r
n &lt;- nrow(tempsample)
xbar &lt;- mean(tempsample$BodyTemp)
s &lt;- sd(tempsample$BodyTemp)
se &lt;- s / sqrt(n)

mu0 &lt;- 37
tobs &lt;- (xbar - mu0) / se
tobs
```

```
## [1] -3.141
```
]

---
# Body temperature example

If you prefer to use tidyverse, you could equivalently do:




```r
stats &lt;- tempsample %&gt;%
    summarise(
        n = n(),
        xbar = mean(BodyTemp),
        s = sd(BodyTemp),
        se = s / sqrt(n),
        mu0 = 37,
        tobs = (xbar - mu0) / se
    )
stats
```

```
## # A tibble: 1 Ã 6
##       n  xbar      s      se   mu0   tobs
##   &lt;int&gt; &lt;dbl&gt;  &lt;dbl&gt;   &lt;dbl&gt; &lt;dbl&gt;  &lt;dbl&gt;
## 1    50 36.81 0.4252 0.06013    37 -3.141
```



---
# Body temperature example

- Recall the value of the t-statistic for the observed sample:


```r
tobs
```

```
## [1] -3.141
```

--

- To make a decision, we compare the observed t-statistic, `\(t = -3.141\)`, to the critical values `\(\pm t^*\)` from a `\(t(49)\)` distribution.


```r
tstar &lt;- qt(c(0.025, 0.975), df = n - 1)
tstar
```

```
## [1] -2.01  2.01
```

--

- Two-sided alternative, so we ask: is the observed `\(t\)` __as or more extreme__ than the two critical values? 

    + Is `\(t \leq -t^*\)` or `\(t \geq t^*\)`? 
    
    + Yes, so reject `\(H_0\)`.
    
---
# Body temperature example


&lt;img src=&quot;data:image/png;base64,#dapr1_2_04_htci_files/figure-html/unnamed-chunk-13-1.png&quot; width=&quot;50%&quot; style=&quot;display: block; margin: auto;&quot; /&gt;

# Body temperature example

- If you were to compute the p-value, you would reach the same conclusion.


```r
pvalue &lt;- pt(-abs(tobs), df = n - 1) + 
          pt( abs(tobs), df = n - 1, lower.tail = FALSE)
pvalue
```

```
## [1] 0.002851
```

- We could say:

&gt; Let `\(\mu\)` denote the mean body temperature of all healthy humans. At the 5% significance level, we performed a one-sample t-test of `\(H_0 : \mu = 37\)` against `\(H_1 : \mu \neq 37\)`. The sample data provided very strong evidence to reject the null hypothesis in favour of the alternative one that the mean body temperature of healthy humans is different from the long thought 37 Â°C; `\(t(49) = -3.14, p = .003\)`, two-sided.

---
# Body temperature example

- At the `\(\alpha = 0.05\)` significance level, the sample data provide very strong evidence to reject `\(H_0 : \mu = 37\)` in favour of `\(H_1 : \mu \neq 37\)`.

--

- However, this doesn&#39;t give us any idea of what the actual population mean may be. It just tells us there is very strong evidence that it&#39;s not 37 Â°C.

--

&gt; __Good practice__  
&gt; When you find a statistically significant result, it is good practice to follow-up the hypothesis test with a confidence interval, in order to provide the reader with an idea of what a plausible value of the population parameter may be.

.pull-left[

```r
tstar &lt;- qt(c(0.025, 0.975), df = n - 1)
tstar
```

```
## [1] -2.01  2.01
```
]

.pull-right[

```r
xbar + tstar * se
```

```
## [1] 36.69 36.93
```
]

- We are 95% confident that the population mean body temperature for healthy humans is between 36.69 Â°C and 36.93 Â°C.


---
# Hypothesis testing and Confidence intervals

- Notice that the 95% confidence interval [36.69, 36.93] does not include the hypothesised value in the null hypothesis (37).

    + As 37 is not within [36.69, 36.93], we reject the null hypothesis `\((H_0 : \mu = 37)\)` at the 5% significance level.

--

- The 95% CI gives us a range of plausible values for the population mean.

--

- As the claimed value 37 is not within the range, that is not a plausible value for `\(\mu\)`. If you test whether the population mean could be equal to 37, you end up rejecting that value.

--

- __Generic fact:__  
The 95% CI gives you a range of values for the parameter that would __not__ be rejected at the 5% significance level in a two-sided hypothesis test.



---
# Body temperature example

- The p-value is .003, indicating that the sample data provide very strong evidence that the population mean is significantly different from 37 Â°C.

    + This is about __statistical significance__
    
    + That is, the result is _very unlikely_ to come from a population where `\(H_0\)` is true and the discrepancy between the sample and population mean is only due to random sampling.

--

- We are 95% confident that the population mean body temperature for healthy humans is between 36.69 Â°C and 36.93 Â°C.

    + The confidence interval tells us that perhaps the true population mean body temperature is somewhere in between 36.69 and 36.93, rather than 37.
    
    + Is this departure from 37 big enough to be of any practical impact for decision makers? 
    
    + Pretty much no, it&#39;s negligible.
    
    + The result, while being significant, is not an __important__ result.
    
    + Hence, statistical significance is different from practical significance (which we call importance), and a statistically significant result may not be of practical significance at all.
    
---
# Significance vs Importance

- In scientific research, and in this course too, the word __significance__ has a special meaning which is different from its everyday language meaning.

- It is a keyword reserved to mean __statistical significance__, i.e. the sample results being unlikely to be observed just because of random variation due to sampling when in fact `\(H_0\)` is true in the population.

- This is __not__ the same meaning as the sample results being __important__ or __practically significant__.


---
# Significance vs Importance

- You can have a significant result, but this doesn&#39;t necessarily mean that it&#39;s __important__. 

    + It&#39;s good practice to always follow-up a significant result (i.e. when you reject the null hypothesis) with a confidence interval, to provide the reader with a measure of the &quot;magnitude&quot; of the departure from the hypothesised value `\(H_0 : \mu = \mu_0\)`.
    
    + In our case, the 95% confidence interval [36.69, 36.93] Â°C indicates that the departure from the currently accepted standard of 37 Â°C is not that big to be of much impact for decision makers.
    
    + This is an example of a statistically significant result that is not of practical importance.
    
???

We could say that we are 95% confident that the population mean is [0.07, 0.31] smaller than 37.
    

---
# Why both?

- If a confidence interval can also be used to perform a hypothesis test, why do we need both?

--

- The answer is that they both provide useful and complementary information.

    + A p-value gives you the __strength of evidence__ that the sample data bring against the null hypothesis. This is not conveyed by a confidence interval.
    
    + The confidence interval gives you an idea of the &quot;magnitude&quot; of the population parameter, which the hypothesis test doesn&#39;t convey.

--

- In summary, report both if you have a significant result, i.e. if you reject the null hypothesis!

    + Always follow up a significant hypothesis test with a confidence interval.
    
    + _Side note_. If the hypothesis test is not significant, and you do not reject `\(H_0 : \mu = 0\)` say, then you do have an idea about the magnitude of the population mean. In fact, by not rejecting the claim that `\(\mu = 0\)` you are told that 0 is a plausible value for the population mean.
